webpackJsonp([0xa91ec82f2260],{396:function(e,t){e.exports={data:{site:{siteMetadata:{title:"MAC0213 Blog",author:"Victor Hugo M. Pinto"}},markdownRemark:{id:"/Users/victorhugo/Projects/mac213-blog/src/pages/25-03/index.md absPath of file >>> MarkdownRemark",html:'<p>Durante a semana dos dias 25/03 à 30/03, busquei recursos online para aprender sobre <em>continuous integration (CI)</em> e <em>continuous delivery (CD)</em>, encontrando diversoss vídeos sobre o assunto e uma documentação muito compreensiva disponibilizada pelo time do <em>Gitlab</em> em <a href="https://docs.gitlab.com/ee/ci/">https://docs.gitlab.com/ee/ci/</a> .</p>\n<p>Como o time responsável pelo FATIMA utiliza uma instância local do <em>Gitlab</em> para hospedar o código da plataforma, vamos utilizar a solução integrada oferecida pelo serviço, a <em>GitLab CI/CD</em>, que é capaz de lidar com CI e CD de forma fácil e conveniente, integrando ambos no <em>workflow</em> natural de desenvolvimento <em>open-source</em>.</p>\n<p>Outros links consultados foram:</p>\n<ul>\n<li><a href="https://about.gitlab.com/stages-devops-lifecycle/">https://about.gitlab.com/stages-devops-lifecycle/</a></li>\n<li><a href="https://docs.gitlab.com/ee/topics/autodevops/">https://docs.gitlab.com/ee/topics/autodevops/</a></li>\n<li><a href="https://docs.gitlab.com/ee/ci/yaml/README.html">https://docs.gitlab.com/ee/ci/yaml/README.html</a></li>\n<li><a href="https://docs.gitlab.com/ee/ci/quick_start/README.html">https://docs.gitlab.com/ee/ci/quick_start/README.html</a></li>\n</ul>\n<p><strong>Horas</strong>: 8 horas</p>',frontmatter:{title:"Primeira semana de estudos",date:"April 04, 2018"}}},pathContext:{slug:"/25-03/",previous:{fields:{slug:"/planning/"},frontmatter:{title:"Planejamento"}},next:{fields:{slug:"/01-04/"},frontmatter:{title:"Segunda semana de estudos"}}}}}});
